import React from 'react';
import '../Styles/About.css';
import profilePic from '../Images/headshot.JPEG';  // Replace with your image

const About = () => {
  return (
    <div className="about-container">
      <div className="about-text">
        <h1>About Me</h1>
        <p>
          I'm passionate about UI/UX design and development. My goal is to create seamless and engaging user experiences.
        </p>
        <p>
          I have experience in frontend development, product design, and digital marketing strategies.
        </p>
        <a href="https://www.linkedin.com/in/your-linkedin-profile" target="_blank" rel="noopener noreferrer" className="linkedin-button">
          Connect with me on LinkedIn!
        </a>
      </div>

      <div className="about-image">
        <img src={profilePic} alt="Profile" />
      </div>
    </div>
  );
};

export default About;
